import React, { useState } from 'react';

const Table = ({ data }) => {
    const [filteredData, setFilteredData] = useState(data);

    const handleFilter = (e, key) => {
        const value = e.target.value;
        const newData = data.filter(item => item[key].toLowerCase().includes(value.toLowerCase()));
        setFilteredData(newData);
    };

    return (
        <table>
            <thead>
            <tr>
                <th>
                    <input type="text" onChange={(e) => handleFilter(e, 'column1')} />
                </th>
                <th>
                    <input type="text" onChange={(e) => handleFilter(e, 'column2')} />
                </th>
                <th>
                    <input type="text" onChange={(e) => handleFilter(e, 'column3')} />
                </th>
                <th>
                    <input type="text" onChange={(e) => handleFilter(e, 'column4')} />
                </th>
                <th>
                    <input type="text" onChange={(e) => handleFilter(e, 'column5')} />
                </th>
            </tr>
            </thead>
            <tbody>
            {filteredData.map((item, index) => (
                <tr key={index}>
                    <td>{item.column1}</td>
                    <td>{item.column2}</td>
                    <td>{item.column3}</td>
                    <td>{item.column4}</td>
                    <td>{item.column5}</td>
                </tr>
            ))}
            </tbody>
        </table>
    );
};

export default Table;
